// src/components/common/Sidebar.js
import React from 'react';
import {
  Drawer,
  List,
  ListItem,
  ListItemButton,
  ListItemIcon,
  ListItemText,
  Divider,
  Box,
  IconButton,
  Typography,
  useTheme
} from '@mui/material';
import CloseIcon from '@mui/icons-material/Close';
import PersonIcon from '@mui/icons-material/Person';
import GroupsIcon from '@mui/icons-material/Groups';
import SmartToyIcon from '@mui/icons-material/SmartToy';
import PsychologyIcon from '@mui/icons-material/Psychology';
import DescriptionIcon from '@mui/icons-material/Description';
import AssignmentIcon from '@mui/icons-material/Assignment';
import BarChartIcon from '@mui/icons-material/BarChart';
import DashboardIcon from '@mui/icons-material/Dashboard';

const sections = [
  { name: 'Dashboard', icon: <DashboardIcon />, id: 'welcome' },
  { name: 'Profilo', icon: <PersonIcon />, id: 'profile' },
  { name: 'Multiagente', icon: <GroupsIcon />, id: 'multiagent' },
  { name: 'ALI', icon: <SmartToyIcon />, id: 'ali' },
  { name: 'Agenti', icon: <PsychologyIcon />, id: 'agents' },
  { name: 'Documenti', icon: <DescriptionIcon />, id: 'my-documents' },
  { name: 'Analisi Legali', icon: <AssignmentIcon />, id: 'legal-analysis' },
  { name: 'Reportistica', icon: <BarChartIcon />, id: 'reports' },
];

function Sidebar({ activeSection, onSectionChange, onClose }) {
  const theme = useTheme();

  return (
    <Drawer
      anchor="left"
      open={true}
      variant="persistent"
      sx={{
        '& .MuiDrawer-paper': {
          width: 260,
          boxSizing: 'border-box',
          boxShadow: theme.shadows[6],
          border: 'none'
        },
      }}
    >
      <Box sx={{ 
        p: 2, 
        display: 'flex', 
        justifyContent: 'space-between', 
        alignItems: 'center'
      }}>
        <Typography 
          variant="h6" 
          sx={{ 
            fontWeight: 'bold',
            background: theme.palette.mode === 'dark' 
              ? 'linear-gradient(45deg, #e3f2fd 30%, #90caf9 90%)'
              : 'linear-gradient(45deg, #1a237e 30%, #3949ab 90%)',
            backgroundClip: 'text',
            WebkitBackgroundClip: 'text',
            color: 'transparent',
          }}
        >
          VALIS
        </Typography>
        <IconButton onClick={onClose} size="small">
          <CloseIcon fontSize="small" />
        </IconButton>
      </Box>

      <Divider sx={{ mx: 2 }} />

      <List sx={{ px: 2, py: 1 }}>
        {sections.map((section) => (
          <ListItem key={section.id} disablePadding sx={{ mb: 0.5 }}>
            <ListItemButton
              selected={activeSection === section.id}
              onClick={() => {
                onSectionChange(section.id);
                if (section.id !== 'welcome') onClose();
              }}
              sx={{
                borderRadius: 2,
                '&.Mui-selected': {
                  backgroundColor: theme.palette.mode === 'dark' 
                    ? 'rgba(66, 66, 255, 0.15)' 
                    : 'rgba(63, 81, 181, 0.12)',
                }
              }}
            >
              <ListItemIcon
                sx={{
                  color: activeSection === section.id 
                    ? 'primary.main' 
                    : 'text.secondary',
                    minWidth: 40
                }}
              >
                {section.icon}
              </ListItemIcon>
              <ListItemText 
                primary={section.name}
                primaryTypographyProps={{
                  fontWeight: activeSection === section.id ? 600 : 400,
                }}
              />
            </ListItemButton>
          </ListItem>
        ))}
      </List>

      <Box sx={{ flexGrow: 1 }} />

      <Box sx={{ p: 2, textAlign: 'center' }}>
        <Typography variant="body2" color="textSecondary">
          Valis by Lexygraph AI
        </Typography>
        <Typography variant="caption" color="textSecondary">
          &copy; {new Date().getFullYear()} - Tutti i diritti riservati
        </Typography>
      </Box>
    </Drawer>
  );
}

export default Sidebar;
